window.bookSummaryJSON = "<p><b>\"He thinks he's a wizard,\" they said.</b></p> <p>For five grand a month and a million-dollar chaser, Roger Mulligan didn't care how crazy the old geezer was. All he had to do was keep Joseph Perry Shackleford alive and keep him from squandering the estate for a year.</p> <p>But they didn't tell him about the pixies.</p>"; 
